class tuple_funs:
    
    @staticmethod
    def hash_tuple(s,bits=12 ):
        s=tuple_funs.tb(s)
        s="0b"+s[3:] # strip valid bit
        return "0x"+(tuple_funs.th(int(tuple_funs.crc(s)[-bits:],2))[2:])
        
    @staticmethod
    def th(s):
        if(type(s)==int):
            return hex(s)
        elif(s[:2]=="0x"):
            return s
        elif(s[:2]=="0b"):
            return hex(int(s[2:],2))
        else:
            return hex(int(s))
    @staticmethod
    def tb(s):
        if(type(s)==int):
            return bin(s)
        elif(s[:2]=="0x"):
            return bin(int(s[2:],16))
        elif(s[:2]=="0b"):
            return s
        else:
            return bin(int(s))
    @staticmethod
    def td(s):
        if(type(s)==int):
            return str(s)
        elif(s[:2]=="0x"):
            return int(s[2:],16)
        elif(s[:2]=="0b"):
            return int(s[2:],2)
        else:
            return s
            
    @staticmethod
    def create_tuple(dic):
        gen=""
        fields = [("valid",1),("port",3),("vport",3),("dmac",48),("smac",48),("typ",16),("vid",12),("pcp",3),("sip",32),("dip",32),("prot",8),("tos",6),("tsp",16),("tdp",16)]
        for x in fields:
            r = tuple_funs.tb(dic[x[0]])[2:]
            gen = gen + r.zfill(x[1]) 
        x=hex(int(gen,2))[2:]
        if(x[len(x)-1]=="L"):
            x=x[:-1]
        return "0x"+x.zfill(61)
    
