    def gen_wr_commands(action, tup, cam_size=4096, dev="/dev/nf10a", hashh=None, cmd="./wraxi"):
        action = tuple_funs.th(action)
        if(hashh==None):
            hashh=tuple_funs.hash_tuple(tup,bits=int(math.log(cam_size,2)))
        hashh = tuple_funs.th(hashh)[2:]
        tup=tuple_funs.th(tup)[2:]    
        if tup[-1] == "L":
            tup=tup[:-1]
        r=[]
        for x in range(0,9):
            if(x<9):
                if(x==0):
                    addr = tuple_funs.tb("0x"+hashh)+"000"
                else:
                    addr = tuple_funs.tb("0x"+hashh)+bin(x-1)[2:].zfill(3)
                #bitshift addr:
                addr = addr + "00"
                addr=hex(int(addr,2))[2:]
                if(x==0):
                    r.append("sudo "+cmd+" "+dev+" 0xB"+addr.zfill(7)+" 0x"+action[2:].zfill(8))
                else:
                    data = tup[-8:]
                    tup = tup[:-8]
                    r.append("sudo "+cmd+" "+dev+" 0xB"+addr.zfill(7)+" 0x"+data.zfill(8))
        return r
